Only functions can be imported in Rust at this time, and they can be imported via raw interfaces like: #[link(wasm_import_module = "the-wasm-import-module")]
extern "C" { // imports the name `foo` from `the-wasm-import-module` fn foo(); // functions can have integer/float arguments/return values fn translate(a: i32) -> f32; // Note that the ABI of Rust and wasm is somewhat in flux, so while this // works, it's recommended to rely on raw integer/float values where // possible. fn translate_fancy(my_struct: MyStruct) -> u32; // you can also explicitly specify the name to import, this imports `bar` // instead of `baz` from `the-wasm-import-module`. #[link_name = "bar"] fn baz();
} When you're using wasm-bindgen you would instead use: use wasm_bindgen::prelude::*; #[wasm_bindgen(module = "the-wasm-import-module")]
extern "C" { fn foo(); fn baz(); // ...
} Note that unless you're using interface types you likely don't need wasm-bindgen.

