For very "unit-y" tests, we add test modules in the same .rs file as the code that is being tested. These test modules are configured to only get compiled during testing with #[cfg(test)]. // some code... #[cfg(test)]
mod tests { use super::*; #[test] fn some_test_for_that_code() { // ... }
} If you're writing a unit test and a test module doesn't already exist, you can create one. For more "integration-y" tests, we create a tests directory within the crate, and put the tests inside there. For example, there are various code cache-related tests at crates/environ/tests/cache_*.rs. Always feel free to add a tests directory to a crate, if you want to add a new test and there aren't any existing tests.
